/*Table structure for table `bookissue` */

DROP TABLE IF EXISTS `bookissue`;

CREATE TABLE `bookissue` (
  `bookIssueId` bigint(100) NOT NULL AUTO_INCREMENT,
  `studid` int(100) DEFAULT NULL,
  `bookMasterId` int(100) DEFAULT NULL,
  `issuedate` date DEFAULT NULL,
  `noofdays` int(100) DEFAULT NULL,
  `issuedby` int(100) DEFAULT NULL,
  `returned` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`bookIssueId`),
  KEY `studid` (`studid`),
  KEY `bookid` (`bookMasterId`),
  KEY `issuedby` (`issuedby`),
  CONSTRAINT `bookissue_ibfk_1` FOREIGN KEY (`studid`) REFERENCES `student` (`sid`),
  CONSTRAINT `bookissue_ibfk_2` FOREIGN KEY (`bookMasterId`) REFERENCES `bookmaster` (`bookMasterId`),
  CONSTRAINT `bookissue_ibfk_3` FOREIGN KEY (`issuedby`) REFERENCES `usermaster` (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=latin1;

